    let user = await this.findOne({
        username: login,
    })

    if (!user) {
        user = await this.findOne({ email: login })
    }
    return user
}

userSchema.pre('remove', function(next) {
    this.model('Message').deleteMany({ user: this._id }, next)
})

const User = mongoose.model('User', userSchema)

